import React from 'react';

const MediaDisplay = ({ media }) => {
  let content = null;
  if (media.type === 'image') {
    content = <img src={media.url} alt={media.alt} />;
  } else if (media.type === 'video') {
    content = <video src={media.url} />;
  }

  return (
    <div>
      {content}
    </div>
  );
};

export default MediaDisplay;
